import React from "react";
import { Col, Row, Container, Nav } from "react-bootstrap";

function Cardie (props){
    return(

            <>
                <h4>{props.name}</h4>
                <p>{props.para}</p>
            </>
    )
}

const Footer = () => {
    return (
        <div style={{color: '#aaaaaa', background: "#111111" , position: "absolute", paddingTop: "80pt", paddingBottom: "80pt", left:"0" , right:"0"}}>
        <Container>
        <Row>
            <Col sm={3}>    
                <Cardie name="Navigation" para={
                    <div>
                        <Nav>
                    <Nav.Link>Home</Nav.Link>
                    <Nav.Link>About</Nav.Link>
                    <Nav.Link>Features</Nav.Link>
                    <Nav.Link>Portfolio</Nav.Link>
                    <Nav.Link>Our Team</Nav.Link>
                    </Nav>
                    </div>
                }
                />
            </Col> 
            <Col sm={3}>    
                <Cardie name="Products" para="On the other hand, we denounce with righteous indignation and dislike men who are so beguiled and demoralized by the charms of pleasure of the moment"/>
            </Col>      

            <Col sm={6}>    
                <Cardie name= "Contact" para="which is the same as saying through shrinking from toil and pain. These cases are perfectly simple and easy to distinguish. In a free hour"/>  
            </Col>
        </Row>
        </Container>
        </div>
     );
}

export default Footer;
